script: |
  super -f text -I q11832.spq | sort > q11832.out

inputs:
  - name: q11832.spq
    data: |
      SELECT * FROM tab0 (FORMAT parquet) WHERE NOT - - col0 / - col1 * col1 NOT IN ( 25 / col2, CAST ( NULL AS INTEGER ) * 89 * col2, + - ( + col2 ) + + col1 );
  - name: tab0

outputs:
  - name: q11832.out
    data: |
      15	81	47
